import Vue from 'vue';
import App from './App.vue';
import VueRouter from 'vue-router';
import Login from './components/Login.vue';
import AddEgresado from './components/AddEgresado.vue';
import ConsultEgresado from './components/ConsultEgresado.vue';

Vue.config.productionTip = false;

Vue.use(VueRouter);

const routes = [
  { path: '/', component: AddEgresado },
  { path: '/login', component: Login },
  { path: '/consultar', component: ConsultEgresado }
];

const router = new VueRouter({
  routes
});

new Vue({
  render: h => h(App),
  router
}).$mount('#app');
